sys_variable_value.value:
(function execute(inputs, outputs) {
    // ... code ...
    try {
        var user = new GlideRecord('sys_user');
        user.addQuery('sys_id', inputs.record_sys_id);
        user.query();

        if (user.next()) {
            user.password_needs_reset = inputs.password_reset;
            user.user_password.setDisplayValue(inputs.password);
            user.update();

            outputs.output_message = "${Success update user password}";
        }
    } catch (err) {
        outputs.error_message = err;
    }

})(inputs, outputs);

